Conforme item 16.2.2, o candidato deverá apresentar os seguintes documentos para realização da matrícula, além dos documentos comprobatórios da ação afirmativa, se for o caso.
16.2.2. Os documentos a serem apresentados, em envelope próprio, no ato da matrícula são:
a) Carteira de Identidade - RG (original e cópia simples legível). A carteira nacional de habilitação
(CNH), para fins de matrícula, não substitui o RG.
b) Certidão de Nascimento ou de casamento (original e cópia simples legível);
c) Número do CPF, caso o número não conste no RG;
d) Certificado/Certidão de Conclusão contendo data da confecção do Histórico Escolar OU
Histórico Escolar do Ensino Médio, de acordo com os requisitos para ingresso descritos no item 2.
deste Edital (original e cópia simples legível).
e) Comprovante de residência (original e cópia simples legível);
f) Comprovante de quitação com o Serviço Militar, para candidato(a)s do sexo masculino com
idade superior a 18 anos (original e cópia simples legível);
g) Número do Título de Eleitor para maiores de 18 anos;
h) 01 fotografia recente 3x4;

